CREATE TABLE articles (
    aId INT NOT NULL,
    cites INT,
    authors	VARCHAR(255),
    title VARCHAR(255),
    year INT,
    journalName VARCHAR(255),
    publisher VARCHAR(255),
    articleURL LONGTEXT,
    citesURL LONGTEXT,
    gsRank INT,
    ECC INT,
    citesPerYear INT,
    citesPerAuthor INT,
    authorCount INT,
    age INT,
    PRIMARY KEY (aId)
);

